import React from 'react';
import './Card.css';

const front = true;

function Flip() {
    front = !front;
};


const Card = (props) => {

    return (
        <div className="card">
            <div style={{
            textAlign: "center",

        }}>
                <h3>
                    {props.title}
                </h3>
            </div>  
            <div style={{
            textAlign: "center"
        }}>
                <button className="card-button">
                    Learn More
                </button>
            </div>

        </div>
    );
};

export default Card;
